import requests
import uuid

BASE_URL = "http://localhost:3000"
HEADERS_JSON = {"Content-Type": "application/json"}
TIMEOUT = 30

def test_orders_management_bulk_import_validation():
    bulk_import_endpoint = f"{BASE_URL}/api/orders/bulk-import"

    # Prepare bulk import payload with two new parts, one with an attachment, one duplicate part number
    unique_part_number = str(uuid.uuid4())[:8]
    duplicate_part_number = "DUPLICATE123"

    payload = {
        "orders": [
            {
                "part_number": unique_part_number,
                "description": "New part request with attachment",
                "quantity": 10,
                "attachments": [
                    {
                        "filename": "spec_sheet.pdf",
                        "filetype": "application/pdf",
                        "content_base64": "JVBERi0xLjQKJ..."  # dummy base64 content shortened
                    }
                ]
            },
            {
                "part_number": duplicate_part_number,
                "description": "First duplicate part",
                "quantity": 5,
                "attachments": []
            },
            {
                "part_number": duplicate_part_number,
                "description": "Second duplicate part",
                "quantity": 3,
                "attachments": []
            }
        ]
    }

    # First, submit a single import with the duplicate part number once to simulate existing order
    initial_payload = {
        "orders": [
            {
                "part_number": duplicate_part_number,
                "description": "Existing part for duplicate check",
                "quantity": 1,
                "attachments": []
            }
        ]
    }
    # Create initial order to cause duplicate conflict in bulk import
    try:
        r_init = requests.post(
            bulk_import_endpoint, json=initial_payload, headers=HEADERS_JSON, timeout=TIMEOUT
        )
        assert r_init.status_code in (200, 201), f"Initial setup failed: {r_init.text}"

        # Now bulk import with duplicate and validate response
        r = requests.post(bulk_import_endpoint, json=payload, headers=HEADERS_JSON, timeout=TIMEOUT)
        assert r.status_code == 400 or r.status_code == 409, "Expected conflict or validation error for duplicates"

        response_json = r.json()
        assert "duplicates" in response_json or "errors" in response_json, "Expected duplicate validation info in response"

        duplicates_reported = response_json.get("duplicates", []) or response_json.get("errors", [])
        assert any(
            dup.get("part_number") == duplicate_part_number for dup in duplicates_reported
        ), "Duplicate part number not reported in the response"

        # Also test attachment support for unique part
        # Assuming the API returns details about successfully created orders
        # If the API allows partial success: check that unique part with attachment was accepted
        success_orders = response_json.get("success", []) if "success" in response_json else []
        unique_part_created = any(
            order.get("part_number") == unique_part_number for order in success_orders
        )
        if r.status_code == 200:
            assert unique_part_created, "Unique part with attachment was not successfully imported"

    finally:
        # Cleanup: Delete all created orders by part_number
        def delete_order_by_part_number(part_number):
            search_endpoint = f"{BASE_URL}/api/orders/search"
            delete_endpoint = f"{BASE_URL}/api/orders"

            # Search orders by part number to get their IDs
            resp_search = requests.get(
                search_endpoint, params={"part_number": part_number}, headers=HEADERS_JSON, timeout=TIMEOUT
            )
            if resp_search.status_code != 200:
                return
            orders_found = resp_search.json().get("orders", [])
            for order in orders_found:
                order_id = order.get("id")
                if order_id:
                    requests.delete(f"{delete_endpoint}/{order_id}", headers=HEADERS_JSON, timeout=TIMEOUT)

        delete_order_by_part_number(duplicate_part_number)
        delete_order_by_part_number(unique_part_number)

test_orders_management_bulk_import_validation()

import requests

BASE_URL = "http://localhost:3000"
TIMEOUT = 30

def test_data_grid_sorting_filtering_virtualization():
    headers = {
        "Accept": "application/json",
        "Content-Type": "application/json"
    }

    # Sample payload to test sorting, filtering, and virtualization features:
    # Assuming the data grid API supports POST /api/datagrid/query with body including sorting, filtering, and pagination params.
    query_payload = {
        "sort": [
            {"field": "partNumber", "order": "asc"},
            {"field": "customerName", "order": "desc"}
        ],
        "filter": {
            "status": {"operator": "eq", "value": "Available"},
            "partNumber": {"operator": "contains", "value": "ABC"}
        },
        "pagination": {
            "startRow": 0,
            "endRow": 50
        },
        "virtualization": True
    }

    response = None
    try:
        response = requests.post(
            f"{BASE_URL}/api/datagrid/query",
            headers=headers,
            json=query_payload,
            timeout=TIMEOUT
        )
    except requests.RequestException as e:
        assert False, f"HTTP request failed: {e}"

    assert response is not None, "No response received"
    assert response.status_code == 200, f"Unexpected status code: {response.status_code}"

    try:
        data = response.json()
    except ValueError:
        assert False, "Response is not valid JSON"

    # Expected structure: {
    #   "rows": [...], 
    #   "lastRow": number or null,
    #   "totalCount": number
    # }
    assert isinstance(data, dict), "Response JSON root should be an object"
    assert "rows" in data, "Response missing 'rows' key"
    assert isinstance(data["rows"], list), "'rows' should be a list"
    assert "lastRow" in data, "Response missing 'lastRow' key"
    assert "totalCount" in data, "Response missing 'totalCount' key"

    # Validate sorting order on the first page of data
    rows = data["rows"]
    if len(rows) > 1:
        # Check primary sort by partNumber ascending
        part_numbers = [row.get("partNumber", "") for row in rows]
        assert part_numbers == sorted(part_numbers), "Rows are not sorted by partNumber ascending"

    # Validate filtering: all rows should have status 'Available' and 'ABC' in partNumber
    for row in rows:
        assert row.get("status") == "Available", f"Row with id {row.get('id')} has incorrect status"
        assert "ABC" in row.get("partNumber", ""), f"Row with id {row.get('id')} does not contain 'ABC' in partNumber"

    # Validate virtualization: totalCount should be >= number of returned rows and lastRow should be integer or null
    total_count = data["totalCount"]
    last_row = data["lastRow"]
    assert isinstance(total_count, int) and total_count >= len(rows), "Invalid totalCount"
    assert (isinstance(last_row, int) and last_row >= len(rows)) or last_row is None, "Invalid lastRow value"


test_data_grid_sorting_filtering_virtualization()

import requests

BASE_URL = "http://localhost:3000"
SEARCH_ENDPOINT = f"{BASE_URL}/api/search"
TIMEOUT = 30
HEADERS = {
    "Content-Type": "application/json"
}

def test_search_functionality_cross_tab_accuracy():
    # Sample queries to test cross-tab search accuracy across VIN, Customer Name, Part Number, and Company fields
    test_queries = {
        "vin": "1HGCM82633A004352",
        "customer_name": "John Doe",
        "part_number": "PN-12345-XYZ",
        "company": "Auto Parts Co"
    }

    for field, query in test_queries.items():
        try:
            response = requests.post(
                SEARCH_ENDPOINT,
                json={"query": query},
                headers=HEADERS,
                timeout=TIMEOUT
            )
            response.raise_for_status()
        except requests.RequestException as e:
            assert False, f"HTTP request failed for {field} search with error: {e}"

        data = response.json()
        # Validate that response is a list (search results)
        assert isinstance(data, list), f"Expected list of results for {field} search, got {type(data)}"

        # At least one matching result is expected for each query
        assert len(data) > 0, f"No results found for {field} search with query '{query}'"

        # Check that each returned result contains the query term in the relevant field (case insensitive)
        matched_items = 0
        for item in data:
            if field == "vin" and "vin" in item and query.lower() in item["vin"].lower():
                matched_items += 1
            elif field == "customer_name" and "customerName" in item and query.lower() in item["customerName"].lower():
                matched_items += 1
            elif field == "part_number" and "partNumber" in item and query.lower() in item["partNumber"].lower():
                matched_items += 1
            elif field == "company" and "company" in item and query.lower() in item["company"].lower():
                matched_items += 1

        assert matched_items > 0, f"No results matched the {field} field for query '{query}'"

test_search_functionality_cross_tab_accuracy()
